import { v4 as uuidv4 } from 'uuid';
import React, { useState, useEffect } from 'react';
import './css/App.css';

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [previousChats, setPreviousChats] = useState([]);
  const [isDarkMode, setIsDarkMode] = useState(false);
  const [sessionId, setSessionId] = useState(uuidv4());


  // Load Google CSE (optional, based on your original)
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://cse.google.com/cse.js?cx=a26bc224caf624533";
    script.async = true;
    document.body.appendChild(script);
    return () => {
      document.body.removeChild(script);
    };
  }, []);

  // Dark mode toggle
  useEffect(() => {
    if (isDarkMode) {
      document.body.classList.add("dark-mode");
    } else {
      document.body.classList.remove("dark-mode");
    }
  }, [isDarkMode]);

  // Fetch previous chats on load
  useEffect(() => {
    const fetchPreviousChats = async () => {
      try {
        const res = await fetch("http://localhost:5000/api/chats");
        const data = await res.json();
        setPreviousChats(data);
      } catch (err) {
        console.error("Failed to fetch previous chats", err);
      }
    };
    fetchPreviousChats();
  }, []);

  // Send message to backend
  const sendMessage = async () => {
    if (!input.trim()) return;

    const userMessage = { text: input, sender: "user" };
    setMessages(prev => [...prev, userMessage]);

    try {
      const response = await fetch("http://localhost:5000/api/chat", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ message: input, sessionId })
      });


      const data = await response.json();
      const botMessage = { text: data.reply, sender: "bot" };
      setMessages(prev => [...prev, botMessage]);
    } catch (err) {
      console.error("Error sending message:", err);
      setMessages(prev => [...prev, { text: "Error sending message.", sender: "bot" }]);
    }

    setInput("");
  };

  const startNewChat = () => {
    setMessages([]);
    setSessionId(uuidv4());
  };


  return (
    <div className="chat-container">
      {/* Sidebar */}
      <div className="sidebar">
        <div className="sidebar-header">
          <h1><strong>Chats</strong></h1>
          <div className="button-group">
            <button className="new-chat-btn" onClick={startNewChat}>
              <span role="img" aria-label="new chat">âž•</span>
            </button>
            <button id="theme-toggle" onClick={() => setIsDarkMode(!isDarkMode)}>
              <strong>{isDarkMode ? "ðŸŒ™" : "ðŸŒ‘"}</strong>
            </button>
          </div>
        </div>

        <h4><strong>Previous Chats</strong></h4>
        {previousChats.map((chat, index) => (
          <div
            key={index}
            className="chat-preview"
            onClick={() => {
              setMessages(chat.messages);
              setSessionId(chat.sessionId); 
            }}

          >
            <p><strong>Chat {index + 1}</strong></p>
          </div>
        ))}
      </div>

      {/* Main Chat Area */}
      <div className="main-content">
        <div className="chat-header">
          <h1><strong>Bhromor</strong></h1>
          <h3></h3>
        </div>

        <div className="chat-box">
          {messages.map((msg, i) => (
            <div key={i} className={`message ${msg.sender}`}>
              {typeof msg.text === 'string' ? <strong>{msg.text}</strong> : msg.text}
            </div>
          ))}
        </div>

        <div className="input-area">
          <input
            value={input}
            onChange={(e) => setInput(e.target.value)}
            placeholder="Type a message..."
            onKeyDown={(e) => e.key === 'Enter' && sendMessage()}
          />
          <button onClick={sendMessage}><strong>Send</strong></button>
        </div>
      </div>
    </div>
  );
}

export default App;




